$("#loginButton").click(function(){var t=$("#userNameInput").val(),i=$("#userPasswordInput").val(),n=$("#loginMessageResult");$.ajax({type:"GET",url:location.origin+"/Home/UserLogin",data:{userName:t,userPassword:i},contentType:"application/json",dataType:"json"}).done(function(t){typeof t.ResultCode=="undefined"?(n.removeClass("alert-danger").addClass("alert-success"),n.text("Entity details: "+JSON.stringify(t))):(n.removeClass("alert-success").addClass("alert-danger"),n.text("Code: "+t.ResultCode+",  Details: "+t.ResultMessage))}).fail(function(t){n.removeClass("alert-success").addClass("alert-danger");n.text("Server error ["+t.status+"]")}).always(function(){n.removeClass("d-none")})});